import "react-native-gesture-handler";
import { StatusBar } from "expo-status-bar";
import React from "react";
import { StyleSheet, Text, View } from "react-native";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";

import * as firebase from "firebase";

// For Firebase JS SDK v7.20.0 and later, measurementId is optional
const firebaseConfig = {
  apiKey: "AIzaSyDFwIOaRSBv1ibGJUH-w_3DZkmliZI1elw",
  authDomain: "uottahackcarpaltunnel.firebaseapp.com",
  projectId: "uottahackcarpaltunnel",
  storageBucket: "uottahackcarpaltunnel.appspot.com",
  messagingSenderId: "1093560330888",
  appId: "1:1093560330888:web:18f4f81fa72908bc6f4d3d",
  measurementId: "G-HM3TLLW88Q",
};

if (firebase.apps.length === 0) {
  firebase.initializeApp(firebaseConfig);
}

import LandingScreen from "./components/Landing";
import TrainingScreen from "./components/Training";
import RegisterScreen from "./components/Register";

const Stack = createStackNavigator();
export default function App() {
  return (
    <Stack.Navigator initialRouteName="Landing">
      <Stack.Screen
        name="Landing"
        component={LandingScreen}
        options={{ headerShown: false }}
      ></Stack.Screen>
      <Stack.Screen
        name="Main"
        component={MainScreen}
        options={{ headerShown: false }}
      ></Stack.Screen>
    </Stack.Navigator>
  );
}
